  overload: "com.google.cloud.speech.v1.SpeechContext.Builder.addAllPhrases*"
  type: "Method"
  package: "com.google.cloud.speech.v1"
  summary: "```\nA list of strings containing words and phrases \"hints\" so that\n the speech recognition is more likely to recognize them. This can be used\n to improve the accuracy for specific words and phrases, for example, if\n specific commands are typically spoken by the user. This can also be used\n to add additional words to the vocabulary of the recognizer. See\n [usage limits](https://cloud.google.com/speech-to-text/quotas#content).\n List items can also be set to classes for groups of words that represent\n common concepts that occur in natural language. For example, rather than\n providing phrase hints for every month of the year, using the $MONTH class\n improves the likelihood of correctly transcribing audio that includes\n months.\n```\n\n`repeated string phrases = 1;`"
  syntax:
    content: "public SpeechContext.Builder addAllPhrases(Iterable<String> values)"
    parameters:
    - id: "values"
      type: "java.lang.Iterable<java.lang.String>"
      description: "The phrases to add."
    return:
      type: "com.google.cloud.speech.v1.SpeechContext.Builder"
      description: "This builder for chaining."
